// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract SwapCart{
    
    struct Item{
        uint itemId;
        string itemImage;
        uint star;
        address seller;
        uint price;
        uint32 dueDate;
    }

    struct User{
        uint userID;
        string userName;
        string deliveryAddress;
        Item[] cart;
        Item[] inventory;
        uint balance;
    }

    IERC20 public token;
    Item[] public itemList;

    mapping(address => User) public users;
    mapping(uint256 => Item) public items;

    using Counters for Counters.Counter;
    Counters.Counter private itemCounter;

    constructor(address _token){
        token = IERC20(_token);
    } 

    modifier ownerCheck(address itmSeller) {  // We check the message sender of transaction. Because, message sender must be same with seller to manage the sale advert. 
        require(msg.sender == itmSeller);
        _;
    }
    modifier buyerCheck(address itmSeller) {  // We check the message sender of transaction. Because, message sender must be a buyer to can give star for any item. (not seller of item)
        require(msg.sender != itmSeller);
        _;
    }
    modifier expireCheck(uint32 itmDueDate) {
        require(itmDueDate >= block.timestamp, "The sale has expired!");  // We check the Due date of sale advert. Because, end time must be greater than now to buy. 
        _;
    }
    modifier balanceCheck(uint itmPrice){
        require(itmPrice <= users[msg.sender].balance, "There is not enough balance in your account!"); // We check the balance of buyer. Because, balance must be greater than item price to buy. 
        _;
    }
    modifier listSizeCheck(){
        require(itemCounter.current() > 0, "There are no products to list yet!"); // We check the size of item list. Because, we should give informaton to user before use listing method.
        _;
    }
    modifier itemAvailabilityCheck(uint itmId){
        require(itmId <= itemCounter.current(), "There is no such item record!"); // We check the availability of item. Because, we should check item before give iformation about item to user.
        _;
    }

    event CreateSaleAdvert(   // We defined the CreateSaleAdvert event to monitor the status of Creating Sale Advert functions in the background and be informed through variables.
        uint id,
        uint price,
        string image,
        uint32 dueDate,
        uint star,
        address indexed seller
    );

    event GetEntireItems(
        Item[] listOfItems,
        address indexed caller
    );

    event AddStar(
        uint itmId,
        uint itmStar,
        address indexed caller
    );

    function createSaleAdvert(uint itmPrice, string memory itmImage, uint32 itmDueDate) external ownerCheck(msg.sender){

        items[itemCounter.current()] = Item({
            itemId:itemCounter.current(),
            price:itmPrice,
            itemImage:itmImage,
            dueDate:itmDueDate,
            star:0,
            seller:msg.sender
        });

        users[msg.sender].inventory.push(items[itemCounter.current()]);
        itemList.push(items[itemCounter.current()]);
        itemCounter.increment();

        emit CreateSaleAdvert(itemCounter.current(),itmPrice,itmImage,itmDueDate,items[itemCounter.current()].star,msg.sender);
    }

    function getEntireItems() public listSizeCheck returns (Item[] memory) {
        emit GetEntireItems(itemList,msg.sender);
        return itemList;
    }

    function addStar(uint itmId) public buyerCheck(items[itmId].seller){
        items[itmId].star++;
        emit AddStar(itmId,items[itmId].star,msg.sender);
    }

    function getItemById(uint itmId) public view itemAvailabilityCheck(itmId) returns (Item memory) {
        return items[itmId];
    }
}

